    this.model = '';
    this.modelChange.emit(this.model);
    this.onKeyPress.emit();
  }

  onHandlechangeHiddenPassword = () => this.passwordHidden = !this.passwordHidden;

  get showSearchIcon() {
    return this.type == 'search';
  }

  get searchIcon() {
    return this.model === '' &&  this.showSearchIcon ?  'search' : 'close'
  }

  get passwordMode() {
    return this.type === 'password';
  }

  get showPasswordIcon() {
    return this.passwordHidden ? 'visibility' : 'visibility_off';
  }
}

import { Component, EventEmitter, Input, Output } from '@angular/core';


@Component({
	selector: 'cs-pagination',
	templateUrl: './pagination.component.html',
	styleUrls: ['./pagination.component.sass']
})
export class PaginationComponent {

  @Input() itemsPerPage = 10;
  @Input() currentPage = 0;
  @Output() currentPageChange = new EventEmitter<number>();


  @Input() list: Array<any> = [];

  handleChangeCurrentPage = () => this.currentPageChange.emit(this.currentPage);

  previous() {
				if (this.currentPage > 0) {
      this.currentPage--;
      this.handleChangeCurrentPage();
    }
  }
  next() {
    if (this.currentPage <= this.nPages)
      this.currentPage++;
    this.handleChangeCurrentPage();
  }

  setSelectionPage(event: any) {
    this.currentPage = parseInt(event.target.value);
    this.handleChangeCurrentPage();
  }

  get nRows() {
    return this.list.length;
  }

  get nPages() {
    return Math.floor(this.nRows / this.itemsPerPage);
  }

  get optionPages() {
    return Array(this.nPages).fill(1).map((x, i) => i);
  }

}

